import React from 'react';

const FaceRecognition = ( {imageUrl} ) => {
	//<FaceRecognition urlText={urlinput} />
	//over here
	//props.urlText will be img src
	return (
		<div>
			<img alt='' src='{imageUrl}' />
		</div>
	)
}

export default FaceRecognition;

